import React from 'react';

const Education_box= props =>(
    <div><h1 className="text-center">{props.education.title}</h1>
<h2 className="text-center">{props.education.schoolName}</h2>
</div>

);

class Education extends React.Component{
    super(){
        this.state={

              educations:{"education":["{title:'name',schoolName:'name'}","{title:'name',schoolName:'name'}"]}
        }
    }

    education_list(){
        return this.state.educations.map(current =>{
            return <Education_box education={current}  />;
        })
    }
    render(){
        return(
            <div className="container-fluid education_bg">
                {this.education_list() }
            </div>
        );
    }
}
